




var TicketTask = function (terminal, terminalControl) {
    var self = this;
    self.terminalControl = terminalControl;
    self.gameCode = terminal.gameCode;
    self.terminalId = terminal.id;
    self.terminalName = terminal.terminalName;
    self.status = terminal.status;
    self.terminal = terminal;
};


module.exports = TicketTask;